# @param {Integer[]} prices
# @return {Integer}
# def max_profit(prices)
#   max_diff = 0
#   0.upto(prices.length - 2) do |i|
#     low = prices[i]
#     (i + 1).upto(prices.length - 1) do |j|
#       high = prices[j]
#       diff = high - low
#       max_diff = diff if diff > max_diff
#     end
#   end
#   max_diff
# end

def max_profit(prices)
  low_indexes = []
  0.upto(prices.length - 1) do |i|
    _c = prices[i + 1]
    _b = prices[i]
    _a = prices[i - 1] if i > 0
    # puts "_a: #{_a} _b: #{_b} _c: #{_c}"
    if ((_b && _a.nil?) || (_b <= _a)) && (_c && _b < _c)
      low_indexes.push([_b, i])
    end
  end

  puts "low_indexes: #{low_indexes}" # [[1, 1], [3, 3]]
  # puts "prices.size #{prices.size} low_indexes.size #{low_indexes.size}"
  max_diff = 0
  while (low, i = low_indexes.shift)
    highest = nil
    highest_i = nil

    prices[(i + 1)..-1].each.with_index do |n, ii|
      if n > low && (highest.nil? || n > highest)
        highest = n
        highest_i = i + 1 + ii
      end
    end

    low_indexes.delete_if { |low_b, low_i|
      low_i > i && low_b > low  &&
      low_b < highest && low_i < highest_i
    }

    diff = highest - low
    max_diff = diff if diff > max_diff
  end
  max_diff
end

